        setUserName(e)
    }

    const emailHandle=(e)=>{
        setEmail(e)
    }

    const passwordHandle=(e)=>{
       setPassword(e)
    }

    const clickHandler=()=>{
       
        axios.post('http://2e8cc01927fc.ngrok.io/user/signup',data)
        .then((response)=>{
            console.log(response)
               
                 setData('')
            })
            .catch((error)=>{
                console.log(error)
            })
    }
